import React from 'react';
import clothes from "../Images/clothes1.jpg";
import "../css/CardList.css";
import Card from './Card';

const CardList = () => {
    return (
        <div class = "new-product">
                 <div class="row">
                <Card image = {clothes}></Card>
                <Card image = {clothes}></Card>
                <Card image = {clothes}></Card>
                <Card image = {clothes}></Card>
              </div>
        </div>
    );
}

export default CardList;
